pragma solidity 0.6.6;

interface SwapInterface {
    function getRate() external view returns(uint256);
}

contract EthSwapTest {

    SwapInterface public swapSourceAddress1 = SwapInterface(0x9392A624AeBaA8dfbed4678438ecD6bC161591E0);

    function eth_rate1() public view returns(uint256) {
        return swapSourceAddress1.getRate();
    }
    function eth_rate2() public view returns(uint256) {
        SwapInterface swapSourceAddress2 = SwapInterface(0x9392A624AeBaA8dfbed4678438ecD6bC161591E0);
        return swapSourceAddress2.getRate();
    }
}
